	const [backgroundColor, setBackgroundColor] = useState('brown');

	const radius = 350
	const hourLen = radius * 0.5
	const minLen = radius * 0.75


	return (
        <div style={{textAlign: 'center', marginTop: '60px' }}>
            {/* CLOCK */}
            <div
                style={{
                    width: `${2 * radius}px`,
                    height: `${2 * radius}px`,
                    backgroundColor: 'tan',
                    borderRadius: '50%',
                    border: '10px solid black',
                    margin: 'auto',
                    transform: 'translateY(-50px)',
                }}
            />

            {/* HOUR HAND */}
            <div
                style={{
                    width: `15px`,
                    height: `${hourLen}px`,
                    backgroundColor: 'green',
                    borderRadius: '4px',
                    margin: 'auto',
                    top: '100px',
                    left: '100px',
                }}
            />
        </div>
	);
}

export default App;
